(11, 1, '2024-09-02 11:58:49', '0000-00-00 00:00:00', '\n					<!-- wp:heading {"align":"wide","fontSize":"gigantic","style":{"typography":{"lineHeight":"1.1"}}} -->\n					<h2 class="alignwide has-text-align-wide has-gigantic-font-size" style="line-height:1.1">Crez votre site avec des blocs</h2>\n					<!-- /wp:heading -->\n\n					<!-- wp:spacer -->\n					<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:columns {"verticalAlignment":"center","align":"wide","className":"is-style-twentytwentyone-columns-overlap"} -->\n					<div class="wp-block-columns alignwide are-vertically-aligned-center is-style-twentytwentyone-columns-overlap"><!-- wp:column {"verticalAlignment":"center"} -->\n					<div class="wp-block-column is-vertically-aligned-center"><!-- wp:image {"align":"full","sizeSlug":"large"} -->\n					<figure class="wp-block-image alignfull size-large"><img src="http://motaphoto.local/wp-content/themes/twentytwentyone/assets/images/roses-tremieres-hollyhocks-1884.jpg" alt="Rose Trmires par Berthe Morisot"/></figure>\n					<!-- /wp:image -->\n\n					<!-- wp:spacer -->\n					<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:image {"align":"full","sizeSlug":"large","className":"is-style-twentytwentyone-image-frame"} -->\n					<figure class="wp-block-image alignfull size-large is-style-twentytwentyone-image-frame"><img src="http://motaphoto.local/wp-content/themes/twentytwentyone/assets/images/in-the-bois-de-boulogne.jpg" alt="Dans le bois de Boulogne par Berthe Morisot"/></figure>\n					<!-- /wp:image --></div>\n					<!-- /wp:column -->\n\n					<!-- wp:column {"verticalAlignment":"center"} -->\n					<div class="wp-block-column is-vertically-aligned-center"><!-- wp:spacer -->\n					<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:image {"sizeSlug":"large","className":"alignfull size-full is-style-twentytwentyone-border"} -->\n					<figure class="wp-block-image size-large alignfull size-full is-style-twentytwentyone-border"><img src="http://motaphoto.local/wp-content/themes/twentytwentyone/assets/images/young-woman-in-mauve.jpg" alt="Jeune femme en mauve par Berthe Morisot"/></figure>\n					<!-- /wp:image --></div>\n					<!-- /wp:column --></div>\n					<!-- /wp:columns -->\n\n					<!-- wp:spacer {"height":50} -->\n					<div style="height:50px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:columns {"verticalAlignment":"top","align":"wide"} -->\n					<div class="wp-block-columns alignwide are-vertically-aligned-top"><!-- wp:column {"verticalAlignment":"top"} -->\n					<div class="wp-block-column is-vertically-aligned-top"><!-- wp:heading {"level":3} -->\n					<h3>Ajouter des compositions de blocs</h3>\n					<!-- /wp:heading -->\n\n					<!-- wp:paragraph -->\n					<p>Les compositions de blocs sont des groupes de blocs pr-conus. Pour en ajouter un, slectionnez le bouton Ajouter un bloc [+] dans la barre doutils en haut de lditeur. Passez  longlet Compositions sous la barre de recherche, et choisissez une composition.</p>\n					<!-- /wp:paragraph --></div>\n					<!-- /wp:column -->\n\n					<!-- wp:column {"verticalAlignment":"top"} -->\n					<div class="wp-block-column is-vertically-aligned-top"><!-- wp:heading {"level":3} -->\n					<h3>Encadrez vos images</h3>\n					<!-- /wp:heading -->\n\n					<!-- wp:paragraph -->\n					<p>Twenty Twenty-One inclut de sublimes bordures pour votre contenu. Avec un bloc dimage slectionn, ouvrez le panneau Styles dans la barre latrale de lditeur. Slectionnez le style de bloc Cadre pour lactiver.</p>\n					<!-- /wp:paragraph --></div>\n					<!-- /wp:column -->\n\n					<!-- wp:column {"verticalAlignment":"top"} -->\n					<div class="wp-block-column is-vertically-aligned-top"><!-- wp:heading {"level":3} -->\n					<h3>Colonnes se chevauchant</h3>\n					<!-- /wp:heading -->\n\n					<!-- wp:paragraph -->\n					<p>Twenty Twenty-One inclut galement un style chevauchement pour le bloc colonnes. Slectionnez un bloc colonnes puis ouvrez le panneau styles dans la barre latrale de lditeur. Slectionnez le style de bloc chevauchement pour lessayer.</p>\n					<!-- /wp:paragraph --></div>\n					<!-- /wp:column --></div>\n					<!-- /wp:columns -->\n\n					<!-- wp:spacer -->\n					<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:cover {"overlayColor":"green","contentPosition":"center center","align":"wide","className":"is-style-twentytwentyone-border"} -->\n					<div class="wp-block-cover alignwide has-green-background-color has-background-dim is-style-twentytwentyone-border"><div class="wp-block-cover__inner-container"><!-- wp:spacer {"height":20} -->\n					<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:paragraph {"fontSize":"huge"} -->\n					<p class="has-huge-font-size">Besoin daide?</p>\n					<!-- /wp:paragraph -->\n\n					<!-- wp:spacer {"height":75} -->\n					<div style="height:75px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer -->\n\n					<!-- wp:columns -->\n					<div class="wp-block-columns"><!-- wp:column -->\n					<div class="wp-block-column"><!-- wp:paragraph -->\n					<p><a href="https://wordpress.org/documentation/article/twenty-twenty-one/">Lire la documentation du thme</a></p>\n					<!-- /wp:paragraph --></div>\n					<!-- /wp:column -->\n\n					<!-- wp:column -->\n					<div class="wp-block-column"><!-- wp:paragraph -->\n					<p><a href="https://wordpress.org/support/theme/twentytwentyone/">Consulter les forums de support</a></p>\n					<!-- /wp:paragraph --></div>\n					<!-- /wp:column --></div>\n					<!-- /wp:columns -->\n\n					<!-- wp:spacer {"height":20} -->\n					<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n					<!-- /wp:spacer --></div></div>\n					<!-- /wp:cover -->', 'Crez votre site avec des blocs', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2024-09-02 11:58:49', '0000-00-00 00:00:00', '', 0, 'http://motaphoto.local/?page_id=11', 0, 'page', '', 0),
