(69, 1, '2024-09-09 11:31:40', '2024-09-09 09:31:40', '<label> NOM\r\n    [text* your-name autocomplete:name] </label>\r\n\r\n<label> E-MAIL\r\n    [email* your-email autocomplete:email] </label>\r\n\r\n<label> RF. PHOTO\r\n    [text* your-subject] </label>\r\n\r\n<label> MESSAGE\r\n    [textarea your-message] </label>\r\n\r\n[submit class:submitbtn "Envoyer"]\n1\n[_site_title] "[your-subject]"\n[_site_title] <wordpress@motaphoto.local>\n[_site_admin_email]\nDe: [your-name] [your-email]\r\nObjet: [your-subject]\r\n\r\nCorps du message:\r\n[your-message]\r\n\r\n-- \r\nCeci est une notification quun formulaire de contact a t envoy sur votre site web ([_site_title] [_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] "[your-subject]"\n[_site_title] <wordpress@motaphoto.local>\n[your-email]\nCorps du message:\r\n[your-message]\r\n\r\n-- \r\nCet e-mail est un accus de rception du formulaire de contact que vous avez envoy sur notre site web ([_site_title] [_site_url]) et dans lequel votre adresse e-mail a t utilise. Si ce nest pas vous, veuillez ignorer ce message.\nReply-To: [_site_admin_email]\n\n\n\nMerci pour votre message. Il a t envoy.\nUne erreur sest produite lors de lenvoi de votre message. Veuillez essayer  nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vrifier et essayer  nouveau.\nUne erreur sest produite lors de lenvoi de votre message. Veuillez essayer  nouveau plus tard.\nVous devez accepter les termes et conditions avant denvoyer votre message.\nVeuillez renseigner ce champ.\nCe champ a une saisie trop longue.\nCe champ a une saisie trop courte.\nUne erreur inconnue sest produite lors du tlversement du fichier.\nVous navez pas les droits ncessaires pour tlverser ce type de fichier.\nLe fichier tlvers est trop volumineux.\nUne erreur sest produite lors du tlversement du fichier.\nVeuillez saisir une date au format AAAA-MM-JJ.\nLa date de ce champ est trop tt.\nLa date de ce champ est trop tardive.\nVeuillez saisir un numro.\nLe chiffre de ce champ est trop petit.\nCe champ a un numro trop long.\nLa rponse  la question est incorrecte.\nVeuillez saisir votre adresse e-mail.\nVeuillez saisisr une URL\nVeuillez saisir un numro de tlphone.', 'Contactez-moi', '', 'publish', 'closed', 'closed', '', 'formulaire-de-contact-1', '', '', '2024-09-23 04:01:36', '2024-09-23 02:01:36', '', 0, 'http://motaphoto.local/?post_type=wpcf7_contact_form&#038;p=69', 0, 'wpcf7_contact_form', '', 0),
(70, 1, '2024-09-09 11:32:07', '2024-09-09 09:32:07', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href="http://motaphoto.local/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2024-09-09 11:32:07', '2024-09-09 09:32:07', '', 2, 'http://motaphoto.local/?p=70', 0, 'revision', '', 0),
